import React from 'react'
import './form.css';

const Form = ()=>{
    return(
        <div className="form-container">
            <form>
                <input className="f-input" type="text" required placeholder="story name..." />
                <textarea className="f-input" type="text" required placeholder="write your story..." />
                <input className="f-input" type="file" required placeholder="select you moment..." />
                <input className="f-input" type="submit" value="post"/>
            </form>
        </div>
    );
}

export default Form;
